Enchanter is a B&amp;W comic published by Eclipse Comics in 1987, featuring elves and wizardry and suchlike. It was created by Don Chin and illustrated by a 19-year old Mike Dringenberg (&quot;Sandman&quot;). Though meant to run for eight issues, it only made it through three. In 1993, the series picked up at Express Press and ran for four issues, with the first three again being penciled by Dringenberg. The series finally concluded in 1995 as a prose novelette, with several illustrations by Tatsuya Ishida.

